import React from 'react';
import styled from 'styled-components';
import Link from 'next/link';

const Menu = styled.header`
  position: flexd;
  top: 0px;
  left: 0px;
  width: 100%;
  height: 50px;
  display: flex;
  align-items: center;
  padding: 0px 10px;
  z-index: 10;
  background-color: rgba(20, 20, 20, 0.8);
  box-shadow: 0px 1px 2px 5px rgba(0, 0, 0, 0.8);
  margin-bottom: 10px;
`;

const List = styled.ul`
  display: flex;
`;

const Item = styled.li`
  width: 50px;
  height: 50px;
  text-align: center;

  & > a {
    color: white;
    height: 50px;
    display: flex;
    align-items: center;
    justify-content: center;
  }
`;

const SLink = styled(Link)`
  height: 50px;
  display: flex;
  align-items: center;
  justify-content: center;
`;

const Header = () => {
  return (
    <Menu>
      <List>
        <Item key="home">
          <SLink href="/">
            <a>Logo</a>
          </SLink>
        </Item>
        <Item key="mydirectory">
          <SLink href="/mydirectory">
            <a>내 서재</a>
          </SLink>
        </Item>
        <Item key="profile">
          <SLink href="/profile">
            <a>내 정보</a>
          </SLink>
        </Item>
        <Item>
          <SLink href="/search">
            <a>Search</a>
          </SLink>
        </Item>
      </List>
    </Menu>
  );
};

export default Header;
